import ear from '../images/ear.png';
import { Image } from 'react-bootstrap';

const Background = () => {

  const Ears = (number, width) => {
    let content = []
    for (let i = 0; i < number; i++) {
      content.push(<Image src={ear} className={"ear e-"+width} />);
    }
    return content;
  };

  return (
    <div className='campo'>
      <div className='background-ear'>
        {Ears(13,50)}
      </div>
      <div className='background-ear'>
        {Ears(11,60)}
      </div>
      <div className='background-ear'>
        {Ears(10,70)}
      </div>
      <div className='background-ear'>
        {Ears(9,80)}
      </div>
      <div className='background-ear'>
        {Ears(8,90)}
      </div>

    </div>
  );
}

export default Background;
